import React, { useEffect, useState } from 'react';
import { getAllVoitures } from '../services/VoitureService';

const VoitureList = () => {
  const [voitures, setVoitures] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchVoitures = async () => {
      try {
        const data = await getAllVoitures();
        setVoitures(data);
      } catch (err) {
        setError(err);
      } finally {
        setLoading(false);
      }
    };

    fetchVoitures();
  }, []);

  if (loading) return <div>Loading voitures...</div>;
  if (error) return <div>Error loading voitures: {error.message}</div>;

  return (
    <table>
      <thead>
        <tr>
          <th>ID</th>
          <th>Marque</th>
          <th>Mod√®le</th>
          <th>Matricule</th>
          <th>ID Client</th>
        </tr>
      </thead>
      <tbody>
        {voitures.map(voiture => (
          <tr key={voiture.id}>
            <td>{voiture.id}</td>
            <td>{voiture.marque}</td>
            <td>{voiture.modele}</td>
            <td>{voiture.matricule}</td>
            <td>{voiture.idclient}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default VoitureList;
